import React, { Component } from "react";
import MuiButton from '@material-ui/core/Button';

const styles = {
  textAlign: "center"
}


class Button extends Component {
  render() {
      return (
        <MuiButton variant="contained" color="primary" textAlign="center"  onClick={this.props.onSubmit}>
          Calcular Oferta
        </MuiButton>
    );
  }
}

export default Button;
